import React, { useState, useEffect } from "react";
import axios from "axios";

const Tweet = () => {
  useEffect(() => {
    axios.get(``);
  });

  return (
    <div className="ui container">
      <p>This is a Tweet</p>
    </div>
  );
};

export default Tweet;
